import axios from "axios"

const API_KEY = "b01a5366f08443068f7d86d4e4d54362"
const URL = "https://api.openweathermap.org/data/2.5/weather"


export const fetch = async (query) => {
    let info = await axios.get(URL, {
        params: {
            q: "query",
            units: "metric",
            APPID: "API_KEY"

        }
    })
    return info

}
